import{_ as a,c as o,o as r,ai as l}from"./chunks/framework.D5JW9q0s.js";const u=JSON.parse('{"title":"Changelog","description":"","frontmatter":{},"headers":[],"relativePath":"reference/changes.md","filePath":"reference/changes.md","lastUpdated":null}'),t={name:"reference/changes.md"};function i(n,e,d,h,s,c){return r(),o("div",null,e[0]||(e[0]=[l('<h1 id="Changelog" tabindex="-1">Changelog <a class="header-anchor" href="#Changelog" aria-label="Permalink to &quot;Changelog {#Changelog}&quot;">â€‹</a></h1><p>All notable changes to this project will be documented in this file.</p><p>The format is based on <a href="https://keepachangelog.com/en/1.1.0/" target="_blank" rel="noreferrer">Keep a Changelog</a>, and this project adheres to <a href="https://semver.org/spec/v2.0.0.html" target="_blank" rel="noreferrer">Semantic Versioning</a>.</p><h2 id="v0.4.0" tabindex="-1">v0.4.0 <a class="header-anchor" href="#v0.4.0" aria-label="Permalink to &quot;v0.4.0 {#v0.4.0}&quot;">â€‹</a></h2><h2 id="Added" tabindex="-1">Added <a class="header-anchor" href="#Added" aria-label="Permalink to &quot;Added {#Added}&quot;">â€‹</a></h2><ul><li><p>Updated documentation, now using VitePress.</p></li><li><p>Add new driver framework to read files using native drivers.</p></li><li><p>Added native driver package extensions on GeoJSON, ShapeFile, GeoParquet, GeoArrow and FlatGeobuf.</p></li><li><p>Geometry columns are now wrapped in a GeometryVector, allowing for future improvements.</p></li></ul><h3 id="Changed" tabindex="-1">Changed <a class="header-anchor" href="#Changed" aria-label="Permalink to &quot;Changed {#Changed}&quot;">â€‹</a></h3><ul><li><p>Now exports GeometryOps and GeoInterface methods instead of ArchGDAL methods for geometry operation.</p></li><li><p>The <code>geom_columns</code> keyword for <code>write</code> is now <code>geometrycolumn</code>, and also accepts a single Symbol.</p></li></ul><h3 id="Removed" tabindex="-1">Removed <a class="header-anchor" href="#Removed" aria-label="Permalink to &quot;Removed {#Removed}&quot;">â€‹</a></h3><ul><li>Removed automatic broadcast implementations of operations like buffer.</li></ul><h2 id="v0.3.13" tabindex="-1">v0.3.13 <a class="header-anchor" href="#v0.3.13" aria-label="Permalink to &quot;v0.3.13 {#v0.3.13}&quot;">â€‹</a></h2><ul><li>Support updating/appending to existing files, by specifying <code>update=true</code> in the <code>write</code> function.</li></ul><h2 id="v0.3.12" tabindex="-1">v0.3.12 <a class="header-anchor" href="#v0.3.12" aria-label="Permalink to &quot;v0.3.12 {#v0.3.12}&quot;">â€‹</a></h2><ul><li>Add <code>always_xy</code> keyword to <code>reproject</code>.</li></ul><h2 id="v0.3.11" tabindex="-1">v0.3.11 <a class="header-anchor" href="#v0.3.11" aria-label="Permalink to &quot;v0.3.11 {#v0.3.11}&quot;">â€‹</a></h2><ul><li><p>Changed <code>reproject</code> to work on a DataFrame, correctly setting the (crs) metadata</p></li><li><p>Handle empty layers</p></li><li><p>Re-export GeoFormatTypes and Extents, making things like <code>CRS</code> and <code>Extent</code> available</p></li><li><p>Warn on possible geometry column instead of throwing an error.</p></li><li><p>Improve error message when file is not found.</p></li></ul><h2 id="v0.3.10" tabindex="-1">v0.3.10 <a class="header-anchor" href="#v0.3.10" aria-label="Permalink to &quot;v0.3.10 {#v0.3.10}&quot;">â€‹</a></h2><ul><li>Changed DataFrame metadata style to <code>:note</code>, preserving crs after DataFrame operations.</li></ul><h2 id="v0.3.9" tabindex="-1">v0.3.9 <a class="header-anchor" href="#v0.3.9" aria-label="Permalink to &quot;v0.3.9 {#v0.3.9}&quot;">â€‹</a></h2><ul><li><p>Implemented GeoInterface methods on DataFrame(Rows).</p></li><li><p>Implements transaction support on writing, notably improving writing performance.</p></li></ul><h2 id="v0.3.8" tabindex="-1">v0.3.8 <a class="header-anchor" href="#v0.3.8" aria-label="Permalink to &quot;v0.3.8 {#v0.3.8}&quot;">â€‹</a></h2><ul><li>Retrieve CRS from layer, instead of dataset, preventing some <code>nothing</code> crs.</li></ul><h2 id="v0.3.7" tabindex="-1">v0.3.7 <a class="header-anchor" href="#v0.3.7" aria-label="Permalink to &quot;v0.3.7 {#v0.3.7}&quot;">â€‹</a></h2><ul><li>Correctly write 3d geometries (which were previously flattened to 2d).</li></ul><h2 id="v0.3.6" tabindex="-1">v0.3.6 <a class="header-anchor" href="#v0.3.6" aria-label="Permalink to &quot;v0.3.6 {#v0.3.6}&quot;">â€‹</a></h2><ul><li>Use GDAL to identify drivers, instead of relying only on file extension.</li></ul><h2 id="v0.3.5" tabindex="-1">v0.3.5 <a class="header-anchor" href="#v0.3.5" aria-label="Permalink to &quot;v0.3.5 {#v0.3.5}&quot;">â€‹</a></h2><ul><li>Drop support for ArchGDAL 0.9.</li></ul><h2 id="v0.3.4" tabindex="-1">v0.3.4 <a class="header-anchor" href="#v0.3.4" aria-label="Permalink to &quot;v0.3.4 {#v0.3.4}&quot;">â€‹</a></h2><ul><li>Use GeoInterface to convert geometries.</li></ul><h2 id="v0.3.3" tabindex="-1">v0.3.3 <a class="header-anchor" href="#v0.3.3" aria-label="Permalink to &quot;v0.3.3 {#v0.3.3}&quot;">â€‹</a></h2><ul><li><p>Update to ArchGDAL 0.10</p></li><li><p>Change default geometry column name to <code>geometry</code> (was <code>geom</code>).</p></li></ul><h2 id="v0.3.2" tabindex="-1">v0.3.2 <a class="header-anchor" href="#v0.3.2" aria-label="Permalink to &quot;v0.3.2 {#v0.3.2}&quot;">â€‹</a></h2><ul><li>Use metadata to store/retrieve CRS and geometry column information.</li></ul><h2 id="v0.3.1" tabindex="-1">v0.3.1 <a class="header-anchor" href="#v0.3.1" aria-label="Permalink to &quot;v0.3.1 {#v0.3.1}&quot;">â€‹</a></h2><ul><li>Error out early on non existent files.</li></ul><h2 id="v0.3.0" tabindex="-1">v0.3.0 <a class="header-anchor" href="#v0.3.0" aria-label="Permalink to &quot;v0.3.0 {#v0.3.0}&quot;">â€‹</a></h2><ul><li><p>Change <code>geom_column</code> to <code>geom_columns</code>, defaulting to using GeoInterface.jl.</p></li><li><p>Added options keyword to pass configuration to the GDAL driver.</p></li><li><p>Allow any GeoInterface.jl compatible geometry to be written (was only ArchGDAL geometries).</p></li></ul><h2 id="v0.2.4" tabindex="-1">v0.2.4 <a class="header-anchor" href="#v0.2.4" aria-label="Permalink to &quot;v0.2.4 {#v0.2.4}&quot;">â€‹</a></h2><ul><li>Upgrade GeoFormatTypes to v0.4</li></ul><h2 id="v0.2.3" tabindex="-1">v0.2.3 <a class="header-anchor" href="#v0.2.3" aria-label="Permalink to &quot;v0.2.3 {#v0.2.3}&quot;">â€‹</a></h2><ul><li>Update ArchGDAL compat to v0.9</li></ul><h2 id="v0.2.2" tabindex="-1">v0.2.2 <a class="header-anchor" href="#v0.2.2" aria-label="Permalink to &quot;v0.2.2 {#v0.2.2}&quot;">â€‹</a></h2><ul><li><p>Expanded documentation</p></li><li><p>Free GDAL structures as soon as possible</p></li></ul><h2 id="v0.2.1" tabindex="-1">v0.2.1 <a class="header-anchor" href="#v0.2.1" aria-label="Permalink to &quot;v0.2.1 {#v0.2.1}&quot;">â€‹</a></h2><ul><li><p>Don&#39;t export <code>isempty</code> as it clashes with other exports</p></li><li><p>Compatability with ArchGDAL v0.8 (adds missing support when reading ðŸŽ‰)</p></li></ul><h2 id="v0.2.0" tabindex="-1">v0.2.0 <a class="header-anchor" href="#v0.2.0" aria-label="Permalink to &quot;v0.2.0 {#v0.2.0}&quot;">â€‹</a></h2><ul><li><p>[breaking] Changed default CRS to <code>nothing</code> instead of WGS84.</p></li><li><p>Users can provide a GDAL driver when writing.</p></li></ul><h2 id="v0.1.6" tabindex="-1">v0.1.6 <a class="header-anchor" href="#v0.1.6" aria-label="Permalink to &quot;v0.1.6 {#v0.1.6}&quot;">â€‹</a></h2><ul><li>Add support for (U)Int8,UInt16,UInt32 datatypes</li></ul><h2 id="v0.1.5" tabindex="-1">v0.1.5 <a class="header-anchor" href="#v0.1.5" aria-label="Permalink to &quot;v0.1.5 {#v0.1.5}&quot;">â€‹</a></h2><ul><li>Compatability with ArchGDAL v0.7</li></ul><h2 id="v0.1.4" tabindex="-1">v0.1.4 <a class="header-anchor" href="#v0.1.4" aria-label="Permalink to &quot;v0.1.4 {#v0.1.4}&quot;">â€‹</a></h2><ul><li><p><a href="www.evetion.nl/GeoDataFrames.jl/dev/reference/api#GeoDataFrames.read"><code>read</code></a> now accepts layer keyword</p></li><li><p>Enables writing of missing data</p></li></ul><h2 id="v0.1.3" tabindex="-1">v0.1.3 <a class="header-anchor" href="#v0.1.3" aria-label="Permalink to &quot;v0.1.3 {#v0.1.3}&quot;">â€‹</a></h2><ul><li>Forwards kwargs in the <a href="www.evetion.nl/GeoDataFrames.jl/dev/reference/api#GeoDataFrames.read"><code>read</code></a> function to ArchGDAL</li></ul><h2 id="v0.1.2" tabindex="-1">v0.1.2 <a class="header-anchor" href="#v0.1.2" aria-label="Permalink to &quot;v0.1.2 {#v0.1.2}&quot;">â€‹</a></h2><ul><li>Changed <a href="www.evetion.nl/GeoDataFrames.jl/dev/reference/api#GeoDataFrames.write"><code>write</code></a> to have keyword arguments</li></ul><h2 id="v0.1.1" tabindex="-1">v0.1.1 <a class="header-anchor" href="#v0.1.1" aria-label="Permalink to &quot;v0.1.1 {#v0.1.1}&quot;">â€‹</a></h2><ul><li>Small internal fixes</li></ul><h2 id="v0.1.0" tabindex="-1">v0.1.0 <a class="header-anchor" href="#v0.1.0" aria-label="Permalink to &quot;v0.1.0 {#v0.1.0}&quot;">â€‹</a></h2><ul><li>First release ðŸŽ‰</li></ul>',62)]))}const p=a(t,[["render",i]]);export{u as __pageData,p as default};
